INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 401, 24, 2, 24001, "アヤネ", "2030/12/17 14:59:59", 2, 102301, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 402, 24, 1, 24002, "アヤネ", "2030/12/17 14:59:59", 2, 102301, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 2.21);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 403, 24, 2, 24003, "アヤネ", "2030/12/17 14:59:59", 2, 102301, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 701, 24, 2, 24004, "アサヒ", "2030/12/17 14:59:59", 1, 192201, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 1.99);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 702, 24, 1, 24005, "アサヒ", "2030/12/17 14:59:59", 2, 192201, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 2.21);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 703, 24, 2, 24006, "アサヒ", "2030/12/17 14:59:59", 1, 192201, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 3.33);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 801, 24, 2, 24007, "部員３", "2030/12/17 14:59:59", 2, 192301, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 802, 24, 1, 24008, "部員３", "2030/12/17 14:59:59", 2, 192301, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 2.68);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 803, 24, 2, 24009, "部員３", "2030/12/17 14:59:59", 2, 192301, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 501, 24, 1, 24010, "", "2030/12/17 14:59:59", 1, 192501, "2020/07/31 12:00:00", "やった！", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 502, 24, 1, 24011, "", "2030/12/17 14:59:59", 1, 192501, "2020/07/31 12:00:00", "勝ったよ！", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 503, 24, 1, 24012, "", "2030/12/17 14:59:59", 1, 192501, "2020/07/31 12:00:00", "いい調子！", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 111, 24, 6, 24013, "ミサト", "2030/12/17 14:59:59", 2, 113501, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 5.33);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 112, 24, 1, 24014, "ミサト", "2030/12/17 14:59:59", 2, 113501, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 6.85);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 113, 24, 1, 24015, "ミサト", "2030/12/17 14:59:59", 2, 113501, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 3.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 611, 24, 1, 24016, "ダイチ", "2030/12/17 14:59:59", 2, 192401, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 6.11);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 612, 24, 1, 24017, "ダイチ", "2030/12/17 14:59:59", 2, 192401, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 6.75);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 613, 24, 2, 24018, "ダイチ", "2030/12/17 14:59:59", 2, 192401, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 211, 24, 2, 24019, "ハツネ", "2030/12/17 14:59:59", 1, 113401, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 4.52);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 212, 24, 2, 24020, "ハツネ", "2030/12/17 14:59:59", 1, 113401, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 3.89);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 213, 24, 1, 24021, "ハツネ", "2030/12/17 14:59:59", 2, 113401, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 13.49);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 311, 24, 1, 24022, "カヤ", "2030/12/17 14:59:59", 2, 106501, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 3.17);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 312, 24, 1, 24023, "カヤ", "2030/12/17 14:59:59", 2, 106501, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 4.42);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 313, 24, 6, 24024, "カヤ", "2030/12/17 14:59:59", 1, 106501, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 2.89);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 421, 24, 4, 24025, "アヤネ", "2030/12/17 14:59:59", 3, 102301, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 3.71);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 721, 24, 2, 24026, "アサヒ", "2030/12/17 14:59:59", 1, 192201, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 5.1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 821, 24, 1, 24027, "部員３", "2030/12/17 14:59:59", 3, 192301, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 4.34);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 521, 24, 1, 24028, "", "2030/12/17 14:59:59", 1, 192501, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 0.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 101, 24, 1, 24029, "ミサト", "2030/12/17 14:59:59", 2, 113501, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", -360.0, 5.62);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 102, 24, 1, 24030, "ミサト", "2030/12/17 14:59:59", 2, 113501, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", -360.0, 9.58);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 103, 24, 2, 24031, "ミサト", "2030/12/17 14:59:59", 2, 113501, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", -360.0, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 104, 24, 2, 24032, "ミサト", "2030/12/17 14:59:59", 1, 113501, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", -360.0, 9.13);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 0.0, 105, 24, 1, 24033, "ミサト", "2030/12/17 14:59:59", 2, 113501, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", -360.0, 8.27);
